import React from 'react';
import {NavLink} from "react-router-dom";

const NavBar = () => {
    return (
        <div>
            <div className=" ui inverted  mini menu">
                <NavLink to='/' className="item fontify">
                   <button> Stream</button>
                </NavLink>
                <NavLink to='/' className="item fontify">
                    Messages
                </NavLink>
                <div className="right menu">
                    <NavLink to ='/' className="ui item fontify">
                        Logout
                    </NavLink>
                </div>
            </div>

        </div>
    );
};

export default NavBar;
